.text
	main:
		lui $s0, 0x1001 #S0  o inicio do mapa
		
		add $a0, $s0, $0 #display
		addi $a1, $s0, 32764 #mapa
		add $a2, $0, $0 #iterador
		jal paintMap
		
		addi $s4, $0, 3 # Vida do personagem
		add $s2, $0, $0 # Pontuacao
		add $s3, $0, $0 # invencibilidade
		add $s5, $0, $0 # mapa completo
		
		j loop
		
	gameOver:
		add $a0, $s0, $0 #display
		la $a1, go0
		add $a2, $0, $0 #iterador
		jal paintMap
		
		addi $v0, $0, 10
		syscall
	
	gameWin:
		add $a0, $s0, $0 #display
		la $a1, gw0
		add $a2, $0, $0 #iterador
		jal paintMap
		
		addi $v0, $0, 10
		syscall
		
	loop:	
		addi $a0, $s0, 65536 # onde o personagem comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		jal handleLife
		
		addi $a0, $s0, 65536
		add $a1, $0, $0 #iterador
		jal handleWin
		
		add $a0, $0, $s0 # onde o mapa comeca
		addi $a1, $s0, 65536 #onde o personagem comeca
		add $a3, $0, $0 #index de pixel
		jal paintPerson
		
		add $a0, $0, $s0 # onde o mapa comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		add $a3, $0, $0 #index de pixel
		jal paintEnemies
		
		addi $a0, $s0, 65536 # onde o personagem comeca
		add $a1, $0, $0 # iterador
		lui $a2, 0xffff #input buffer
		jal handleInput
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		addi $a2, $s0, 65888 #onde os inimigos movimento
		addi $a3, $s0, 32764 
		jal moveEnemies
		
		#addi $v0, $0, 10
		#syscall
		
		j loop
		
	# Usa: a0  onde o display comeca; a1: onde desenho do mapa comeca
	# Suja: t1, t2
	paintMap:
		lw $t1, 0($a1)
		sw $t1, 0($a0)
		addi $a0, $a0, 4 # Densidade  4
		addi $a1, $a1, 4 # ..
		addi $a2, $a2, 1 # Quantidade pintados
		bne $a2, 8192, paintMap #quantidade total de pixels 128*64
		jr $ra
		
	# a0: onde o display comeca
	handleWin:
		beq $s5, 836, gameWin
				
		jr $ra
		
	# a0: onde a posicao do personagem comeca
	# a1: onde a posicao dos iniimigos comecam
	handleLife:
		#life changes
		sgt $t0, $s3, 0
		mul $t0, $t0, -1
		add $s3, $s3, $t0 #removendo invencibilidade
		forPersonPosition:
			lw $t1, 0($a0) # local
			
			add $t3, $0, $0
			forEnemyPosition:
				lw $t2, 0($a1)
				beq $t2, $t1, removeLife
				
				addi $a1, $a1, 4 #proximo pixel de inimigo
				addi $t3, $t3, 1
				ble $t3, 33, forEnemyPosition
			
			addi $a0, $a0, 4 #proxima posicao do personagem			
			ble $a0, 65756, forPersonPosition
		
		j noRemoveLife
		removeLife:
			bne $s3, 0, noRemoveLife # se tiver invencivel
			addi $s3, $0, 3000 #30  o tempo
			sub $s4, $s4, 1 #subtraindo vida
			
			beq $s4, 0, gameOver
			
			add $t0, $0, 127 #deslocamento
			add $t3, $s4, -3
			mul $t3, $t3, 6
			add $t0, $t0, $t3
			
			addi $v0, $0, 1
			add $a0, $0, $s4
			syscall
			
			addi $v0, $0, 11
			add $a0, $0, '\n'
			syscall
			
			addi $t3, $0, 2 # t3  o indice da linha
			paintLifeY:
				mul $t2, $t3, 128 #multiplicando para avancar linha
				add $t5, $t2, $t0 #deslocamento para direita
				
				add $t4, $0, $0 #condicao de parada
				paintLifeX:
					mul $t1, $t5, 4
					add $t1, $s0, $t1 #posicao no display
					sw $0, 0($t1)
				
					addi $t5, $t5, 1 #adicionando 1 pixel
					addi $t4, $t4, 1 # aducuibabdi 1 no iterador
					bne $t4, 7, paintLifeX
					
				addi $t3, $t3, 1
				bne $t3, 7, paintLifeY
				
		noRemoveLife:
		#endlifechanges
		jr $ra
		
		
		
	# a0 onde o display comeca. 
	# a1 onde o personagem comeca
	# a3 index do pixel do personagem
	paintPerson:
		#Local da tela
		lw $t1, 0($a1)
		mul $t1, $t1, 4
		add $t1, $t1, $a0
		#----
		
		add $t3, $a1, 44 		
		lw $t2, 0($t3)
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a3, $a3, 1 
		bne $a3, 11, paintPerson
		
		jr $ra
		
	# a0 onde o display comeca
	# a1 onde os inimigos comecam
	# a3 index de iteracao 
	paintEnemies:
		#Local da tela
		lw $t1, 0($a1)
		mul $t1, $t1, 4
		add $t1, $t1, $a0 
		#----
		
		add $t3, $a1, 132		
		lw $t2, 0($t3)
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a3, $a3, 1 
		bne $a3, 33, paintEnemies
		
		jr $ra
	
	# a0: onde o display comeca
	# a1: onde os inimigos comecam	
	# a2: iterador
	clearEnemies:
		#Local da tela
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel
		#----
		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a2, $a2, 1
		bne $a2, 33, clearEnemies
		
		jr $ra	
		
	# a0: onde o display comeca
	# a1: onde os inimigos comecam
	# a2: onde os movimentos comecam
	moveEnemies:
		#movendo-se apenas em determinados tempos
	
		add $t3, $0, $a0
		add $t4, $0, $a1
		
		addi $v0, $0, 30
		syscall
		
		and $a0, $a0, 4095 #8191
		addi $a1, $0, 100 #1000
		div $a0, $a1
		mflo $a0
		addi $a0, $a0, 1
		
		addi $a1, $0, 2
			
		div $a0, $a1 #ver se  par
		mfhi $t0		
		beq $t0, $s1, endMovement #ver se mudou entre par e impar
		add $s1, $0, $t0
		
		add $a0, $t3, $0
		add $a1, $t4, $0
		#end move
		
		# limpa os iniimigos
		add $t3, $0, $a0
		add $t4, $0, $a1
		add $t5, $0, $a2
		add $t6, $0, $ra
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65624 #onde os inimigos comecam
		add $a2, $0, $0
		jal clearEnemies
		
		add $a0, $t3, $0
		add $a1, $t4, $0
		add $a2, $t5, $0
		add $ra, $t6, $0
		#fim limpeza
		 
		addi $t0, $0, 0
		forEachEnemy:
			beq $t0, 33, endMovement
			
			# gerenciando o movimento
			add $t9, $0, $0
			add $s7, $0, $0
			lw $t1, 20($a1) #Centro do e1
			
			addi $t2, $t1, 1 #local a direita
			mul $t2, $t2, 4 # local no display
			add $t2, $t2, $a3 #somando ao mapa backup
			lw $t2, 0($t2) #valor no mapa
			sne $t2, $t2, 0x00
			add  $s7, $s7, $t2 # possibilidades
			mul $t2, $t2, 1 #movimento
			
			addi $t3, $t1, -1 #local a esquerda
			mul $t3, $t3, 4 # local no display
			add $t3, $t3, $a3 #somando ao mapa 
			lw $t3, 0($t3) #valor do display
			sne $t3, $t3, 0x00
			add $s7, $s7, $t3
			mul $t3, $t3, -1 #movimento
			
			addi $t4, $t1, 128 #local a baixo
			mul $t4, $t4, 4 # local no display
			add $t4, $t4, $a3 #somando ao mapa 
			lw $t4, 0($t4) #valor do display
			sne $t4, $t4, 0x00
			add $s7, $s7, $t4
			mul $t4, $t4, 128 #movimento
			
			addi $t5, $t1, -128 #local acima
			mul $t5, $t5, 4 # local no display
			add $t5, $t5, $a3 #somando ao mapa 
			lw $t5, 0($t5) #valor do display
			sne $t5, $t5, 0x00
			add $s7, $s7, $t5
			mul $t5, $t5, -128 #movimento
			
			#remove inconstant move
			lw $t8, 0($a2) #le movimento atual
			beq $t8, 0, endContinue
					
			seq $t6, $t8, $t2 # se o valor de movimento atual estiver disponivel 
			seq $t7, $s7, 2 # se so tiverem duas possibilidates
			add $t6, $t6, $t7 # soma os 2
			beq $t6, 2, continueOldMove
			
			seq $t6, $t8, $t3 # se o valor de movimento atual estiver disponivel 
			seq $t7, $s7, 2 # se so tiverem duas possibilidates
			add $t6, $t6, $t7 # soma os 2
			beq $t6, 2, continueOldMove
			
			seq $t6, $t8, $t4 # se o valor de movimento atual estiver disponivel 
			seq $t7, $s7, 2 # se so tiverem duas possibilidates
			add $t6, $t6, $t7 # soma os 2
			beq $t6, 2, continueOldMove
			
			seq $t6, $t8, $t5 # se o valor de movimento atual estiver disponivel 
			seq $t7, $s7, 2 # se so tiverem duas possibilidates
			add $t6, $t6, $t7 # soma os 2
			beq $t6, 2, continueOldMove
			
			j endContinue
			
			continueOldMove:
				add $t9, $0, $t8 # continua o movimento
				j fimMov
			endContinue:
			#end unconstant
					
			makeDecision:
			#randomizando
			add $t6, $0, $a0
			add $t7, $0, $a1
			
			addi $v0, $0, 42
			add $a0, $0, $0
			addi $a1, $0, 4
			syscall
			
			add $a1, $t7, $0
			add $t7, $0, $a0 #o valor randomizado
			add $a0, $t6, $0
			#end randomizando
		
			add $t9, $0, $0
			
			seq $t6, $t7, 0
			mul $t8, $t2, $t6
			add $t9, $t9, $t8
			
			seq $t6, $t7, 1
			mul $t8, $t3, $t6
			add $t9, $t9, $t8
			
			seq $t6, $t7, 2
			mul $t8, $t4, $t6
			add $t9, $t9, $t8
			
			seq $t6, $t7, 3
			mul $t8, $t5, $t6
			add $t9, $t9, $t8
			
			#end
			
			fimMov:
						
			sw $t9, 0($a2)
			
			#fim gerenciamento, valor aumentado vai para t9
		
			add $t5, $0, $0
			forEachEnemyPixel:
				beq $t5, 11, endForEachEnemyPixel
				
				lw $t6, 0($a1)
				add $t6, $t6, $t9
				sw $t6, 0($a1)
				
				add $a1, $a1, 4 #proximo local
				addi $t5, $t5, 1 #proximo index
				j forEachEnemyPixel
			
			
			endForEachEnemyPixel:
			
			addi $a2, $a2, 4 #passando para proximo Inimigo movimente
			addi $t0, $t0, 11 #pulando para proximo
			j forEachEnemy
			
		endMovement:
		jr $ra
		
		
	# a0: onde o display comeca
	# a1: onde o personagem comeca
	# a2: iterador
	clearPerson:
		#Local da tela
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel
		#----
		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup
		sw $t2, 0($t1)
		
		addi $a1, $a1, 4
		addi $a2, $a2, 1
		bne $a2, 11, clearPerson
		
		# - map color change -
		addi $a1, $a1, -24
		lw $t1, 0($a1) # endereco da posicao inicial do p
		mul $t1, $t1, 4 #multiplica por 4 para pegar local da tela
		add $t1, $t1, $a0 #adiciona ao inicio do display: pego o pixel

		
		lw $t2, 32764($t1) #Mesmo pixel do mapa backup	
		bne $t2, 0x00900000, jumpMapColorChange
		addi $t2, $0, 0x000090
		sw $t2, 32764($t1)
		addi $s5, $s5, 1 # 1 na pontuacao
		
		jumpMapColorChange:
		
		jr $ra	
	
	handleInput:
		lw $t0, 0($a2)
		
		beq $t0, $0, endHandleInput # se n tiver no buffer
		
		#limpando personagem para mover
		add $t4, $ra, $0
		add $t5, $a0, $0
		add $t6, $a1, $0
		add $t7, $a2, $0
		
		add $a0, $0, $s0 # onde o display comeca
		addi $a1, $s0, 65536 #onde o personagem comeca
		add $a2, $0, $0 #index de pixel
		jal clearPerson
		
		add $ra, $t4, $0
		add $a0, $t5, $0
		add $a1, $t6, $0
		add $a2, $t7, $0
		#end
		
		add $t1, $0, $0 # O quanto o personagem se movera 
		lw $t3, 4($a2)
		
		beq $t3, 'a', minus1
		beq $t3, 's', more128
		beq $t3, 'd', more1
		beq $t3, 'w', minus128
		
		minus1:
			addi $t2, $0, -1
			j endMore
		
		minus128:
			addi $t2, $0, -128
			j endMore
			
		more1:
			addi $t2, $0, 1
			j endMore
			
		more128:
			addi $t2, $0, 128
			j endMore
		
		endMore:
		#verificar se o boneco fica no preto	
		lw $t1, 20($a0) #pega pixel central do boneco
		add $t1, $t1, $t2 #adiciona a quanto vai aumentar
		mul $t1, $t1, 4 #multiplica por 4
		add $t1, $t1, $s0 #adiciona ao endereco inicial do display
		lw $t3, 0($t1)
		beq $t3, 0x00, endHandleInput
		
		changePosition:
			lw $t1, 0($a0)
			add $t1, $t1, $t2		
			sw $t1, 0($a0)
			
			addi $a0, $a0, 4	
			addi $a1, $a1, 1		
			bne $a1, 11, changePosition
				
		endHandleInput:
		jr $ra
	
		
	
	

